sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == '200' && inputs.response) {
      try {
        var jsonFormat=gs.xmlToJSON(inputs.response);
      	var response=jsonFormat["s:Envelope"]["s:Body"]["m:SubscribeResponse"]["m:ResponseMessages"]["m:SubscribeResponseMessage"];
        gs.info(JSON.stringify(response));
        var responseStatus=response["ResponseClass"];
        if (responseStatus == 'Success') {
            outputs.status = "Success";
            var subscriptionID=response['m:SubscriptionId'];
            var watermark=response['m:Watermark'];
          	outputs.subscription_id=subscriptionID;
          	outputs.watermark=watermark;
            }
         else{
            outputs = new ExchangeErrorHandler().createPullSubscription(inputs, outputs);
         }
      }
      catch(e) {
        outputs = new ExchangeErrorHandler().createPullSubscription(inputs, outputs);
      }
    } else{
      outputs = new ExchangeErrorHandler().createPullSubscription(inputs, outputs);
   	}
})(inputs, outputs);

